function guid(len) { 
        var buf = [], 
            chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789', 
            charlen = chars.length, 
            length = len || 32; 
             
        for (var i = 0; i < length; i++) { 
            buf[i] = chars.charAt(Math.floor(Math.random() * charlen)); 
        } 
         
        return buf.join(''); 
    } 
 
function generateUniqueId(len) { 
    const alphabet = "abcdefghijklmnopqrstuvwxyz"; 
    const alphanumeric = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789"; 
    const timestamp = Date.now().toString(36); // Convert timestamp to base 36 
    const randomChars = Array.from({ length: len - timestamp.length }, () => 
        alphanumeric.charAt(Math.floor(Math.random() * alphanumeric.length)) 
    ).join(""); 
    const firstChar = alphabet.charAt(Math.floor(Math.random() * alphabet.length)); 
    return firstChar + randomChars + timestamp; 
} 
 
function nameToHSL(name) { 
  let fakeDiv = document.createElement("div"); 
  fakeDiv.style.color = name; 
  document.body.appendChild(fakeDiv); 
  let cs = window.getComputedStyle(fakeDiv), 
      pv = cs.getPropertyValue("color"); 
  document.body.removeChild(fakeDiv); 
  // Code ripped from RGBToHSL() (except pv is substringed) 
  let rgb = pv.substr(4).split(")")[0].split(","), 
      r = rgb[0] / 255, 
      g = rgb[1] / 255, 
      b = rgb[2] / 255, 
      cmin = Math.min(r,g,b), 
      cmax = Math.max(r,g,b), 
      delta = cmax - cmin, 
      h = 0, 
      s = 0, 
      l = 0; 
  if (delta == 0) 
    h = 0; 
  else if (cmax == r) 
    h = ((g - b) / delta) % 6; 
  else if (cmax == g) 
    h = (b - r) / delta + 2; 
  else 
    h = (r - g) / delta + 4; 
  h = Math.round(h * 60); 
  if (h < 0) 
    h += 360; 
  l = (cmax + cmin) / 2; 
  s = delta == 0 ? 0 : delta / (1 - Math.abs(2 * l - 1)); 
  s = +(s * 100).toFixed(1); 
  l = +(l * 100).toFixed(1); 
  return "hsl(" + h + "," + s + "%," + l + "%)"; 
} 
 
function nameToHex(name) { 
  // Get RGB from named color in temporary div 
  let fakeDiv = document.createElement("div"); 
  fakeDiv.style.color = name; 
  document.body.appendChild(fakeDiv); 
  let cs = window.getComputedStyle(fakeDiv), 
      pv = cs.getPropertyValue("color"); 
  document.body.removeChild(fakeDiv); 
  // Code ripped from RGBToHex() (except pv is substringed) 
  let rgb = pv.substr(4).split(")")[0].split(","), 
      r = (+rgb[0]).toString(16), 
      g = (+rgb[1]).toString(16), 
      b = (+rgb[2]).toString(16); 
  if (r.length == 1) 
    r = "0" + r; 
  if (g.length == 1) 
    g = "0" + g; 
  if (b.length == 1) 
    b = "0" + b; 
  return "#" + r + g + b; 
} 
 
function hexToHSL(H) { 
  // Convert hex to RGB first 
  let r = 0, g = 0, b = 0; 
  if (H.length == 4) { 
    r = "0x" + H[1] + H[1]; 
    g = "0x" + H[2] + H[2]; 
    b = "0x" + H[3] + H[3]; 
  } else if (H.length == 7) { 
    r = "0x" + H[1] + H[2]; 
    g = "0x" + H[3] + H[4]; 
    b = "0x" + H[5] + H[6]; 
  } 
  // Then to HSL 
  r /= 255; 
  g /= 255; 
  b /= 255; 
  let cmin = Math.min(r,g,b), 
      cmax = Math.max(r,g,b), 
      delta = cmax - cmin, 
      h = 0, 
      s = 0, 
      l = 0; 
  if (delta == 0) 
    h = 0; 
  else if (cmax == r) 
    h = ((g - b) / delta) % 6; 
  else if (cmax == g) 
    h = (b - r) / delta + 2; 
  else 
    h = (r - g) / delta + 4; 
  h = Math.round(h * 60); 
  if (h < 0) 
    h += 360; 
  l = (cmax + cmin) / 2; 
  s = delta == 0 ? 0 : delta / (1 - Math.abs(2 * l - 1)); 
  s = +(s * 100).toFixed(1); 
  l = +(l * 100).toFixed(1); 
  //return "hsl(" + h + "," + s + "%," + l + "%)"; 
  return "" + h + "_" + s + "%_" + l + "%"; 
} 
 
function dataURLToBlob(dataURL) { 
  // Code taken from https://github.com/ebidel/filer.js 
  var parts = dataURL.split(';base64,'); 
  var contentType = parts[0].split(":")[1]; 
  var raw = window.atob(parts[1]); 
  var rawLength = raw.length; 
  var uInt8Array = new Uint8Array(rawLength); 
  for (var i = 0; i < rawLength; ++i) { 
    uInt8Array[i] = raw.charCodeAt(i); 
  } 
  return new Blob([uInt8Array], { type: contentType }); 
} 
 
